import React from 'react';
import { NavLink } from "react-router-dom";

export const Header = () => {
  return(
    <div>
      <NavLink exact to='/'>Variant 1</NavLink>
      <NavLink to='/alternative'>Variant 2</NavLink>
    </div>
  )
};
